import React from "react";
// Componente dinámico
const ButtonComponents = ({ infoBoton, handleOnClick }) => {
  return (
    <button
      type="button"
      class="btn btn-success btn-lg ml-auto"
      on
      onClick={() => {
        handleOnClick();
      }}
    >
      {infoBoton}
    </button>
  );
};

export default ButtonComponents;
